import React from "react";
import './navbar.css'
import Logo from './assets/img/logo.png';

function NavBar(){
    return (
        <div className="nav-container">
            <nav className="nav">
                <div className="logo">
                    <a href="#"><img src={Logo} alt="metamask logo"></img></a>
                </div>

            </nav>
        </div>
      );
}

export default NavBar;
